import Accordion from 'react-bootstrap/Accordion';
import { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import { useNavigate } from 'react-router'

/*Supplements*/
import BrainBoosters from './Supplements/BrainBoosters.js';
import HeartHealth from './Supplements/HeartHealth.js';
import JointHealth from './Supplements/JointHealth.js';
import LiverTonic from './Supplements/LiverTonic.js';
import NaturalAntiOxidants from './Supplements/NaturalAntiOxidants.js';
import HormonesOralContraceptives from './Supplements/HormonesOralContraceptives.js';
import SlimmingWeightMgmt from './Supplements/SlimmingWeightMgmt.js';
/*Injury*/
import BluntTrauma from './Injury/BluntTrauma.js';
import MuscleRelaxants from './Injury/MuscleRelaxants.js';
import WoundHealing from './Injury/WoundHealing.js';
/*Illness*/
import CoughCold from './Illness/CoughCold.js';
import EarNoseThroat from './Illness/EarNoseThroat.js';
import UrinaryIncontinence from './Illness/UrinaryIncontinence.js';
import Dermatological from './Dermatological/Dermatological.js';
import Disinfectants from './Disinfectants/Disinfectants.js';
import MedicalTools from './MedicalTools/MedicalTools.js';

function Product () {

    const [pageStatus, setPageStatus] = useState("");
    
    useEffect(() => {
        const navigate = useNavigate()
        navigate(0)

        const page = window.localStorage.getItem('pageStatus');
        if ( page !== null && page !== "" ) {
            setPageStatus(JSON.parse(page));
        } else {
            setPageStatus("BB");
        }
    }, []);

    const clickHandler = (message) => {
        setPageStatus(message);
        window.localStorage.setItem('pageStatus', JSON.stringify(message));
    }



    
    return (
        <>
            <div className="container section product">
                <div className="row">
                    <div className="col-12 col-sm-4">

                        <Accordion defaultActiveKey="0" flush>
                            <Accordion.Item eventKey="0">
                                <Accordion.Header>Supplements</Accordion.Header>
                                <Accordion.Body>
                                    <ul>
                                        <li><Link to="/products/brain-boosters-memory-enhancers" onClick={() => clickHandler("BB")} className={`${((pageStatus === "BB") || (pageStatus === "")) ? 'itemActive' : ''}`}>Brain boosters / Memory enhancers</Link></li>
                                        <li><Link to="/products/heart-health" onClick={() => clickHandler("HH")} className={`${pageStatus === "HH" ? 'itemActive' : ''}`}>Heart health </Link></li>
                                        <li><Link to="/products/joint-health" onClick={() => clickHandler("JH")} className={`${pageStatus === "JH" ? 'itemActive' : ''}`}>Joint health </Link></li>
                                        <li><Link to="/products/liver-tonic" onClick={() => clickHandler("LT")} className={`${pageStatus === "LT" ? 'itemActive' : ''}`}>Liver tonic </Link></li>
                                        <li><Link to="/products/natural-antioxidants" onClick={() => clickHandler("NAO")} className={`${pageStatus === "NAO" ? 'itemActive' : ''}`}>Natural anti-oxidants </Link></li>
                                        <li><Link to="/products/hormones-oral-contraceptives" onClick={() => clickHandler("HOC")} className={`${pageStatus === "HOC" ? 'itemActive' : ''}`}>Hormones / Oral contraceptives </Link></li>
                                        <li><Link to="/products/slimming-weight-management" onClick={() => clickHandler("SWM")} className={`${pageStatus === "SWM" ? 'itemActive' : ''}`}>Slimming / Weight management </Link></li>
                                    </ul>
                                </Accordion.Body>
                            </Accordion.Item>
                            <Accordion.Item eventKey="1">
                                <Accordion.Header>Injury</Accordion.Header>
                                <Accordion.Body>
                                    <ul>
                                        <li><Link to="/products/blunt-trauma" onClick={() => clickHandler("BT")} className={`${pageStatus === "BT" ? 'itemActive' : ''}`}>Blunt trauma / Bruising</Link></li>
                                        <li><Link to="/products/muscle-relaxants" onClick={() => clickHandler("MR")} className={`${pageStatus === "MR" ? 'itemActive' : ''}`}>Muscle relaxants</Link></li>
                                        <li><Link to="/products/wound-healing" onClick={() => clickHandler("WH")} className={`${pageStatus === "WH" ? 'itemActive' : ''}`}>Wound healing</Link></li>
                                    </ul>
                                </Accordion.Body>
                            </Accordion.Item>
                            <Accordion.Item eventKey="2">
                                <Accordion.Header>Illness</Accordion.Header>
                                <Accordion.Body>
                                <ul>
                                        <li><Link to="/products/cough-cold" onClick={() => clickHandler("CC")} className={`${pageStatus === "CC" ? 'itemActive' : ''}`}>Cough & cold preparations</Link></li>
                                        <li><Link to="/products/ear-nose-throat" onClick={() => clickHandler("ENT")} className={`${pageStatus === "ENT" ? 'itemActive' : ''}`}>Ear, nose & throat preparations</Link></li>
                                        <li><Link to="/products/urinary-incontinence" onClick={() => clickHandler("UI")} className={`${pageStatus === "UI" ? 'itemActive' : ''}`}>Urinary incontinence</Link></li>
                                    </ul>
                                </Accordion.Body>
                            </Accordion.Item>
                            <Accordion.Item eventKey="3" className="singleItem">
                                <Accordion.Header className="catItem">
                                    <Link to="/products/dermatological" onClick={() => clickHandler("DE")} className={`${pageStatus === "DE" ? 'itemActive' : ''}`}>Dermatological</Link>
                                </Accordion.Header>
                            </Accordion.Item>
                            <Accordion.Item eventKey="4" className="singleItem">
                                <Accordion.Header className="catItem">
                                    <Link to="/products/disinfectants" onClick={() => clickHandler("DI")} className={`${pageStatus === "DI" ? 'itemActive' : ''}`}>Disinfectants</Link>
                                </Accordion.Header>
                            </Accordion.Item>
